"use strict";
const tambah = (x, y) => {
    return x + y;
};
const kurang = (x, y) => {
    return x - y;
};
const kali = (x, y) => {
    return x * y;
};
const bagi = (x, y) => {
    return x / y;
};
console.info(tambah(33, 77));
console.info(kurang(77, 33));
console.info(kali(33, 77));
console.info(bagi(1000, 77));
